import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom';
import { PubNubProvider } from 'pubnub-react';
import PubNub from 'pubnub';
import App from './App';
import './index.css';

const router = {
  future: {
    v7_startTransition: true,
    v7_relativeSplatPath: true
  }
};

// Initialize PubNub with default or stored settings
const initializePubNub = () => {
  const settings = localStorage.getItem('pubnub_settings');
  if (settings) {
    const { subscribeKey, publishKey, uuid } = JSON.parse(settings);
    return new PubNub({
      subscribeKey,
      publishKey,
      uuid,
      ssl: true
    });
  }
  // Default configuration if no settings exist
  return new PubNub({
    subscribeKey: 'demo',
    publishKey: 'demo',
    uuid: 'default-user'
  });
};

const pubnub = initializePubNub();

ReactDOM.render(
  <React.StrictMode>
    <PubNubProvider client={pubnub}>
      <BrowserRouter future={router}>
        <App />
      </BrowserRouter>
    </PubNubProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
